using ChatX.Interfaces.Service;
using ChatX.Model;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace ChatX.Service
{


    public class WebService : IWebService
    {
        private readonly IChatXLog _log;
        public WebService(IChatXLog log) => _log = log;


        public Task<IEnumerable<UserModel>> GetUsers(string token)
        {
            _log.Info("GetUsers",this);
            var users = new List<UserModel>();
            for (int i = 0; i < 20; i++)
            {
                string avastr = "";
                if (i % 2 == 0)
                    avastr = "";
                users.Add(new UserModel { Name = "User_" + i.ToString(),
                    ImageBase64String = avastr });
            }
            return Task.FromResult(users.AsEnumerable());
        }

        public Task<SessionModel> SignIn(LoginModel loginModel)
        {
            _log.Info("SignIn", this);
            var session = new SessionModel
            {
                CurrentUser = new UserModel { ImageBase64String = string.Empty, Name = "Karl Karlovich" },
                Token = "token_this"
            };
            return Task.FromResult(session);
        }
    }
}
